import './Left.css'
import { FaFacebookF } from 'react-icons/fa';

function Left() {
  return (
    <div className='left_wrapper'>
        <div className='left_icons'>
            <a><FaFacebookF/></a>
            <a><FaFacebookF/></a>
            <a><FaFacebookF/></a>
            <a><FaFacebookF/></a>
        </div>
    </div>
  )
}

export default Left
